import heart from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/heart.png";
import CommonParent from "./CommonParent";
import web from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/home_pic.png";
const Home = (props) => {
  return (
    <div id="home" className=" #home">
      <CommonParent
        name={
          <p>
            Hello! my name is <span className="navbar-brand">Maah Asghar.</span>
          </p>
        }
        text={
          <p>
            I am a <span className="navbar-brand"> Software Engineer</span>
            and an
            <span className="navbar-brand"> Illustrator</span>
            based in London, Ontario, Canada.
          </p>
        }
        imgsrc={web}
        visit1="/#projects"
        btname1="View Projects"
        visit2="/#resume"
        btname2="View Resume"
      />

      {/* <CommonParent
        name="Hello! my name is "
        imgsrc={web}
        visit="/projects"
        btname="View Projects"
      /> */}
    </div>
  );
};

export default Home;
